if mibBuilder.loadTexts: mscLpDS3ImaLkFailureCause.setStatus('mandatory')
if mibBuilder.loadTexts: mscLpDS3ImaLkFailureCause.setDescription('This attribute indicates the failure cause on this link. Possible values are: noFailure: there is no failure on this link. interfaceDown: the physical port used by the link is down. lif: the link is in loss of IMA frame (LIF) state. lods: the link is in loss of delay synchronization (LODS) state; that is, it has exhibited a differential delay which is greater than the maximum differential delay tolerated by the IMA group. It must be noted that hysteresis is used for the LODS condition. protocolError: the link is down because of a time-out or because bad values are being received in IMA Control Protocol (ICP) cells. remoteFailure: the far end link is down. misconnected: the link is down because the IMA group has declared, after using its transmit test pattern procedure, that this link is not properly connected. This value can occur only if the protocol for the IMA group is atmForum10. unsupportedFrameLength: the link is down because it is receiving from the far end a frame length which is not supported by the local IMA group. This value can occur only if the protocol for the IMA group is atmForum10. unsupportedSymmetry: the link is down because it is receiving from the far end a group symmetry which is not supported by the local IMA group. This value can occur only if the protocol for the IMA group is atmForum10. noIcp: the link is down because it is not receiving IMA Control Protocol (ICP) cells. This value can occur only if the protocol for the IMA group is atmForum10.')
