if mibBuilder.loadTexts: mscLpImaLinkSelectionCriterion.setStatus('mandatory')
if mibBuilder.loadTexts: mscLpImaLinkSelectionCriterion.setDescription('This attribute specifies the method to be used by the IMA group when selecting links to be activated. This comes into effect only when the configured links do not respect the maximum differential delay (otherwise all links are accepted). If leastDelay is chosen, first the link having the smallest delay is selected as the reference link. The IMA group includes all links which respect the maximum differential delay relative to the reference link. If maxBandwidth is chosen, the IMA group selects the maximum possible number of links, with each selected link respecting the maximum differential delay relative to every other selected link. When more than one possibility exists, the combination which offers the least delay isselected. The default value for Multi-Service Access cards is leastDelay, and for all other cards is maxBandwidth. On Multi-Service Access cards leastDelay is the only acceptable provisionable value.')
