if mibBuilder.loadTexts: mscLpImaProtocol.setDescription("This attribute specifies what protocol the component should run. If atmForum10 is chosen, the ATM Forum's IMA protocol (version 1.0) will be used and signalled in outgoing IMA Control Protocol (ICP) cells. This protocol is specified in version 1.1 of the ATM Forum IMA specification. The IMA group will come up only if the far end IMA also uses the ATM Forum's IMA protocol. If proprietary is chosen, Nortel's proprietary IMA protocol will be used. The IMA group will come up only if the far end IMA also uses Nortel's proprietary IMA protocol. This IMA group will not inter-operate with IMA implementations from other vendors. Feature ima must be provisioned on the LP for this protocol to be used.")
