mscLpImaReceiveCellUtilization = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 12, 22, 12, 1, 4), Gauge32().subtype(subtypeSpec=ValueRangeConstraint(0, 100))).setMaxAccess("readonly")
