if mibBuilder.loadTexts: mscLpImaLkFailureCause.setStatus('mandatory')
if mibBuilder.loadTexts: mscLpImaLkFailureCause.setDescription('This attribute indicates the failure cause on this link. Possible values are: noFailure: there is no failure on this link. interfaceDown: the physical port used by the link is down. lif: the link is in loss of IMA frame (LIF) state. lods: the link is in loss of delay synchronization (LODS) state; that is, it has exhibited a differential delay which is greater than the maximum differential delay tolerated by the IMA group. It must be noted that hysteresis is used for the LODS condition. protocolError: the link is down because of a time-out or because bad values are being received in IMA Control Protocol (ICP) cells. remoteFailure: the far end link is down. misconnected: the link is down because the IMA group has declared, after using its transmit test pattern procedure, that this link is not properly connected. This value can occur only if the protocol for the IMA group is atmForum10. unsupportedFrameLength: the link is down because it is receiving from the far end a frame length which is not supported by the local IMA group. This value can occur only if the protocol for the IMA group is atmForum10. unsupportedSymmetry: the link is down because it is receiving from the far end a group symmetry which is not supported by the local IMA group. This value can occur only if the protocol for the IMA group is atmForum10. noIcp: the link is down because it is not receiving IMA Control Protocol (ICP) cells. This value can occur only if the protocol for the IMA group is atmForum10.')
mscLpImaLkRemoteDefect = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 12, 22, 3, 11, 1, 2), Integer32().subtype(subtypeSpec=ConstraintsUnion(SingleValueConstraint(0, 1, 2, 3, 4))).clone(namedValues=NamedValues(("noDefect", 0), ("physicalLayerDefect", 1), ("lif", 2), ("lods", 3), ("interfaceDown", 4)))).setMaxAccess("readonly")
if mibBuilder.loadTexts: mscLpImaLkRemoteDefect.setStatus('mandatory')
if mibBuilder.loadTexts: mscLpImaLkRemoteDefect.setDescription('This attribute indicates the IMA remote defect indicator (RDI) currently being received on this link. Possible values are: noDefect: no defect. physicalLayerDefect: the interface used by the remote link has a physical layer defect. This value can occur only if the protocol for the IMA group is atmForum10. interfaceDown: the physical interface used by the remote link is down.This value can occur only if the protocol for the IMA group is proprietary. lif: the remote link has a loss of IMA frame (LIF) defect. lods: the remote link has a loss of delay synchronization (LODS) defect; that is, it has exhibited a differential delay which is greater than the maximum differential delay tolerated by the IMA group.')
mscLpImaLkRemoteLid = MibTableColumn((1, 3, 6, 1, 4, 1, 562, 36, 2, 1, 12, 22, 3, 11, 1, 3), Unsigned32().subtype(subtypeSpec=ValueRangeConstraint(0, 31))).setMaxAccess("readonly")
